import React from "react";
import './card.css'

function Card({ icon, title, children }) {
  return (
    <div className="card mt-4">
      <div className="card-header">
        <h2>
          {title}
        </h2>
      </div>
      <div className="card-body">{children}</div>
    </div>
  );
}

export default Card;
